INSERT INTO `examples` VALUES (20745,1,'а̄вьл ко̄ввсэсьт ко̄ррэ','aav\'l koovvses\'t koorre','привязать в куваксе (в чуме) аввель'),(20746,1,'а̄вьл чиннэ','aav\'l činne','(лыһкэ)  приготовить  (сделать) аввель'),(20747,2,'вӣллькесь та̄лл','v\'iil\'l\'k\'es\' taall','белый медведь'),(20748,2,'ниӈӈлэсс та̄лл','ɲ\'iŋŋless taall','медведица'),(20749,2,'Та̄л Ака','taal aka','фольк. Медведица'),(20750,5,'ця̄к вуэнч ке̄ммна','c\'aak vuenč k\'eemmna','! разруби мясо на куски для котла!'),(20751,5,'ця̄һкэ пӯдзэтҍ','c\'aahke puuʒet','! пометьте оленей'),(20752,6,'мунн-дэдт тон те̄да','munn-dedt ton t\'eeda','я-то тебя знаю'),(20753,7,'касьт-дэдтӭ со̄нн адтҍ лӣ','kas\'t-dedte soonn adt l\'ii','?! где-то он сейчас?!'),(20754,8,'кнӣга-дэн ло̄гкекь','kɲ\'iiga-den loogk\'ek\'','? ты книгу-то прочёл?'),(20755,9,'пе̄ннэ-налла','p\'eenne-nalla','по-собачьи'),(20756,9,'пе̄ннэ лӣ паллтас-налла','p\'eenne l\'ii palltas-nalla','собака похожа на волка'),(20757,11,'пуада эмм та̄рьм, а ента','puada emm taar\'m, a jenta','я приду не сегодня, а завтра'),(20758,11,'мунн лӣннче пӯдзэ пынньенҍ, а со̄нн ля̄ннч лӣхемь лаппьсъенҍ','munn l\'iinnče puuʒe pɨɲ\'ɲ\'jen\', a soonn l\'aannč l\'iix\'em\' lap\'p\'sjen\'','я буду оленеводом, а она будет дояркой;'),(20759,11,'а ке̄ тоннӭ цӣӆькэ тэнн баяс?','a k\'ee ton\'n\'e c\'iil̥\'ke tenn bajas?','а кто тебе сказал об этом?'),(20760,13,'ке̄ссь ля̄йй аббрай','k\'ees\'s\' l\'aajj abbraj','лето было дождливым'),(20761,14,'мунн тэнн ке̄зь аббрша','munn tenn k\'eez\' abbrša','я считаю это лето дождливым'),(20762,15,'еськ пе̄ййв поашьтэ ё аббрэй','jes\'k p\'eejjv poaš\'te jo abbrej','только что было солнечно, вдруг пошёл дождь'),(20763,18,'ке̄сся тоаййв эбьрэ','k\'ees\'s\'a toajjv eb\'re','лётом часто шёл дождь'),(20764,19,'аббьр аббр','ab\'b\'r abbr','дождь идёт; аббьр оалкхувэ дождь начался; эбьрэнҍ тӣвтэ пугк вӯметҍ водой залило все долины; аббьр-чалма капля (букв. глазок) дождя; коам аббьр проливной дождь, ливень'),(20765,20,'аббьръесь ке̄ссь','ab\'b\'rjes\'